import React from 'react'
import './LightRain.css'

class LightRain extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return(
      <div className="lightRainContainer">
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
        <div className="rainDrop"></div>
      </div>
    )
  }
}
